import React from 'react';

const ProfessorHome = () => {
  return (
    <div>
      <h1>Professor Dashboard</h1>
      <a href="/professor/upload">Upload Notes</a>
      <a href="/professor/manage">Manage Quizzes</a>
    </div>
  );
};

export default ProfessorHome;
